import React, { useState } from "react";
import "../css/shop.css";
import 'boxicons'

const Shop = () => {
  const [img, setImg] = useState(1);
  

  const shopImages = [
    "https://www.bvbonlineshop.com/media/image/2b/b9/0f/Int-Shop-Hauptbuehne-neu.jpg",
    "https://www.bvbonlineshop.com/media/image/74/g0/b1/Int-Shop-Hauptbuehne-1920x650px-PUMA-SALE-EN.jpg"
  ];
  return (
    <div className="shop-container-wrapper" id="shop">
      <h1>SHOP</h1>
      <div className="shop-container">
        <div className="shop-images">
          <img
            src={shopImages[img]}
            alt="news-background"
          />
          <div className="arrows">
          <a className="arrow-left" onClick={() => console.log('click')}><i class='bx bx-chevron-left' ></i></a>
          <a className="arrow-right"><i class='bx bx-chevron-right'></i></a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Shop;
